import React, { useEffect } from 'react';
import './App.css';

function NearbyDermatologists() {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_GOOGLE_MAPS_API_KEY&libraries=places&callback=initMap`;
    script.async = true;
    document.body.appendChild(script);

    window.initMap = () => {
      // Get user's current location
      if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(
          (position) => {
            const userLocation = {
              lat: position.coords.latitude,
              lng: position.coords.longitude,
            };

            const map = new window.google.maps.Map(document.getElementById('map'), {
              center: userLocation,
              zoom: 12,
            });

            const service = new window.google.maps.places.PlacesService(map);
            const request = {
              location: userLocation,
              radius: '5000',
              type: ['doctor'],
              keyword: 'dermatologist',
            };

            service.nearbySearch(request, (results, status) => {
              if (status === window.google.maps.places.PlacesServiceStatus.OK) {
                results.forEach((place) => {
                  new window.google.maps.Marker({
                    position: place.geometry.location,
                    map,
                    title: place.name,
                  });
                });
              }
            });
          },
          () => {
            alert('Unable to retrieve your location. Please enable location services.');
          }
        );
      } else {
        alert('Geolocation is not supported by your browser.');
      }
    };
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Nearby Dermatologists</h2>
        <div id="map" style={{ width: '100%', height: '500px' }}></div>
      </header>
    </div>
  );
}

export default NearbyDermatologists;
